import './App.css';
import {BrowserRouter, Route, Switch} from "react-router-dom"
import Navbar from './component/Navbar/Navbar';
import AddBook from './component/Book/AddBook';
import Books from './component/Book/Books';

function App() {
  return (
    <>
    <BrowserRouter>
    <Navbar/>
    <AddBook/>
    <Books/>
    </BrowserRouter>
    </>
  );
}

export default App;
